import React, { Component } from 'react';
import Link from 'next';
import Meta from './Meta';
import SideNav from './SideNav';

class Page extends Component {
  render() {
    return (
      <div>
        <Meta />
        {/* <TopBar /> */}
        <div className="p-8">
          {/* <Header /> */}

          <h1 className="text-5xl leading-none lowercase">
            <Link href="/">
              <a className="font-bold">Social Meedz</a>
            </Link>
          </h1>
          <SideNav />
          {this.props.children}
        </div>
      </div>
    );
  }
}

export default Page;
